def SmartSquare(inlist, inplace):
    a = [ ]
    b = len(inlist)
    for i in range(b):
        c = inlist[i]
        d = c ** 2
        #a.append(d)
        if inplace == True:
            for i in range (b):
                c = d
            return c
        else:
            import math
            for i in range (b):
                c = int(math.sqrt(c))
            for i in range (b):
                a.append(d)
            return a



